import {
    precompileTemplate
} from "@ember/template-compilation";
export default precompileTemplate("<div class=\"select-kit-header-wrapper\">\n  {{#each this.icons as |icon|}} {{d-icon icon}} {{/each}}\n\n  {{component this.selectKit.options.selectedNameComponent tabindex=this.tabindex item=this.selectedContent selectKit=this.selectKit shouldDisplayClearableButton=this.shouldDisplayClearableButton}}\n\n  {{#if this.selectKit.options.showCaret}}\n    {{d-icon this.caretIcon class=\"caret-icon\"}}\n  {{/if}}\n  &#8203;\n  {{!-- Zero-width space character, so icon-only button height = regular button height --}}\n</div>", {
    moduleName: "select-kit/components/dropdown-select-box/dropdown-select-box-header.hbs"
});